    AOS.init({
      duration: 1000, // duraci칩n de las animaciones en ms
      once: true,     // si quieres que las animaciones ocurran solo una vez
    });
  }, []);
  return (
    <section className="text-white flex flex-col gap-2 justify-start items-start w-80% mt-5">
        <h1 className='text-6xl font-black' data-aos="fade-up">Compr치 tus Monedas</h1>
        <p className='font-bold'>Seguro, confiable y r치pido</p>
        <button>Ver Precios</button>
    </section>
  );
}

export default App;
